import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screenings, setScreenings] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreenings')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                console.log(data); // Log the data to verify it's not empty
                setScreenings(data);
            })
            .catch(error => console.error(error)); // Log any errors
    }, []);

    console.log(screenings); // Log the screenings state to verify it's being updated

    return (
        <div>
            <h1>Welcome as Guest</h1>
            {screenings.map(screening => (
                <div key={screening.id}>
                    <h2>{screening.movieTitle}</h2>
                    <p>{screening.showTime}</p>
                </div>
            ))}
        </div>
    );
}

export default GuestPage;
